// SORTING

function sortMeBy(arg, sel, elem, order) {
    var $selector = $(sel),
        $element = $selector.children(elem);

    $element.sort(function(a, b) {
        var an = parseInt(a.getAttribute(arg)),
        bn = parseInt(b.getAttribute(arg));

        if (order == 'asc') {
            if (an > bn)
                return 1;
            if (an < bn)
                return -1;
        } else if (order == 'desc') {
            if (an < bn)
                return 1;
            if (an > bn)
                return -1;
        }
        return 0;
    });

    $element.detach().appendTo($selector);
}

$(document).on('click', '.sort1', function() {
    sortMeBy('data-price', '#results', '.search-result', 'asc');
});

$(document).on('click', '.sort2', function() {
	sortMeBy('data-price', '#results', '.search-result', 'desc');
});


// Listen for orientation changes under tablet
var windowWidth = $(window).width();

if ($(window).width() < 767) {

	$('#menu-item-135 > a').click(function(event) {
		event.preventDefault();
	});

	window.addEventListener("orientationchange", function() {

		// Announce the new orientation number
		if(window.orientation > 0) {
			$('.turnme').show('fast')
			$(body).addClass('disablescroll')
		} else {
			$('.turnme').hide()
			$(body).removeClass('disablescroll')
		}

	}, false);

}

